import {useAppDispatch, useAppSelector} from "./hooks/redux";
import {fetch_wares} from "./redux/action_creators/ware_action_creator";
import {login} from "./redux/action_creators/authorization_action_creator";

function App() {
    const dispatch = useAppDispatch()
    const {wares,isLoading} = useAppSelector(state => state.wareReducer)
    const {user, error} = useAppSelector(state => state.authorizationReducer)

    useEffect(() => {
        dispatch(fetch_wares())
        dispatch(login("nomoremikolo", "123123"))
    }, [])
  return (
    <>
        {wares.map(item => (
            <h1>{item}</h1>
        ))}
        {
            user?.username
        }
        {
            error
        }

      {/*<Header/>*/}
